import React from 'react';

function Building(props)
	{
	if(props.isUnlocked)
		{


		return(

		<div>
			<div> BUY FOR:
				{props.buyPrice.grey> 0 ? "grey: "+props.buyPrice.grey+" ":null} 
				{props.buyPrice.red> 0 ? "red: "+props.buyPrice.red+" ":null} 

				</div>
			 <div>SELL: {props.sellPrice} </div>
		{props.isBuyable ? <button name={props.name} onClick={props.handleBuildingBuy}>
		{props.name}
		
		</button>:null}
			<div> COUNT:{props.count}
		</div>
		</div>

		)
	}
	else{return null}
}


export default Building;
